import AlbumsCompoment from "../../components/albums/AlbumsCompoment";
import ArtistsComponent from "../../components/artists/ArtistsComponent";
import FavoritesComponent from "../../components/favorites/FavoritesComponent";
import Header from "../../components/header/Header";
import Navbar from "../../components/navbar/Navbar";
import EpisodesPage from "../episodes/EpisodesPage";
import GenresPage from "../genres/GenresPage";
import PlaylistsPage from "../playlists/PlaylistsPage";
import PodcastsPage from "../podcastsPage/PodcastsPage";
import "./homePage.scss";

const HomePage = () => {
  return (
    <div className="home-page">
      <Header />
      <Navbar />
      <FavoritesComponent />
      <AlbumsCompoment />
      <ArtistsComponent />
      <EpisodesPage />
      <GenresPage />
      <PlaylistsPage />
      <PodcastsPage />
    </div>
  );
};

export default HomePage;
